import { FC, useRef, DetailedHTMLProps, CanvasHTMLAttributes } from "react";
import '../styles/canvas.scss';

const Canvas: FC = () => {
    const canvasRef: MutableRefObject<HTMLCanvasElement> = useRef();

    return (
        <div className="canvas">
            <canvas 
                width={600} 
                height={400}
                ref={canvasRef}
                />
        </div>
    )
}

export default Canvas;
